import './App.css';
import {Aterrizaje,NotFound} from './Paginas/index'
import {Routes, Route} from 'react-router-dom'
function App() {
  return (
    <>
      <Routes>
        <Route path='/' element={<Aterrizaje/>}></Route>
        <Route path='*' element={<NotFound/>}></Route>
      </Routes>
    </>
  );
}

export default App;
